import React from "react";
import "./Selector.css";

const Selector = (props) => {
    return (
        <div className="selector">
            <select>
                {
                    props.courses.map((course, desc) => {
                        <option>{course}</option>
                    })
                }
            </select>
        </div>
    );
}

export default Selector;
